        setIsVisible(false);
    };

    return (
        <>
            {isVisible && (
                <div className="chatbot">
                    <button className="close-button" onClick={handleClose}>X</button>
                    <p>Chatbot content goes here!</p>
                </div>
            )}
        </>
    );
};

export default Test;
